import { Center, Text, VStack,   RangeSlider, RangeSliderTrack, RangeSliderFilledTrack, RangeSliderThumb,   Slider, SliderTrack, SliderFilledTrack, SliderThumb, SliderMark,} from '@chakra-ui/react';

function Rslider () {
  return(
    <RangeSlider aria-label={['min', 'max']} defaultValue={[1, 1000]}>
      <RangeSliderTrack>
        <RangeSliderFilledTrack />
      </RangeSliderTrack>
      <RangeSliderThumb index={0} />
      <RangeSliderThumb index={1} />
    </RangeSlider>
  )
}

function Nslider () {
  return(
    <Slider aria-label='slider-ex-1' defaultValue={30}>
      <SliderTrack>
        <SliderFilledTrack />
      </SliderTrack>
      <SliderThumb />
    </Slider>
  )
}
const Question1 = (): JSX.Element => (
  <div>
    <Center mt="64px">
      <Text fontSize='2xl'>0</Text>
      <VStack spacing="32px">
        <Text fontSize='4xl'>IBU(International Bitterness Units)</Text>
        <Rslider/>
      </VStack>
      <Text fontSize='2xl'>100</Text>
    </Center>
    <Center mt="64px">
      <Text fontSize='2xl'>0</Text>
      <VStack spacing="32px">
        <Text fontSize='4xl'>ABV(Alcool By Volume)</Text>
        <Nslider/>
      </VStack>
      <Text fontSize='2xl'>57.5</Text>
    </Center>
  </div>
);
export default Question1;
